ostgres?useUnicode=true&characterEncoding=utf8&useSSL=true&autoReconnect=true&reWriteBatchedInserts=true\n#    username: root\n#    password: password\n\nspring:\n  datasource:\n    type: com.zaxxer.hikari.HikariDataSource\n    # 动态数据源文档 https://www.kancloud.cn/tracy5546/dynamic-datasource/content\n    dynamic:\n      # 性能分析插件(有性能损耗 不建议生产环境使用)\n      p6spy: true\n      # 开启seata代理，开启后默认每个数据源都代理，如果某个不需要代理可单独关闭\n      seata: ${seata.enabled}\n      # 严格模式 匹配不到数据源则报错\n      strict: true\n      hikari:\n        # 最大连接池数量\n        maxPoolSize: 20\n        # 最小空闲线程数量\n        minIdle: 10\n        # 配置获取连接等待超时的时间\n        connectionTimeout: 30000\n        # 校验超时时间\n        validationTimeout: 5000\n        # 空闲连接存活最大时间，默认10分钟\n        idleTimeout: 600000\n        # 此属性控制池中连接的最长生命周期，值0表示无限生命周期，默认30分钟\n        maxLifetime: 1800000\n        # 连接测试query（配置检测连接是否有效）\n        connectionTestQuery: SELECT 1\n        # 多久检查一次连接的活性\n        keepaliveTime: 30000\n','20037e06fc3ece6c1e165c617024d561','2010-05-05 00:00:00','2023-06-27 18:06:59','nacos','172.19.0.1','U','3001',''),(0,208,'org.dromara.system.api.RemoteUserService','mapping','','ruoyi-system','b348e7aa119003cb46eabd0c7f548cd0','2010-05-05 00:00:00','2023-06-27 18:07:34',NULL,'192.168.31.37','I','3001',''),(0,209,'org.dromara.system.api.RemoteUserService:::provider:ruoyi-system','DUBBO_GROUP','','{\"annotations\":[],\"canonicalName\":\"org.dromara.system.api.RemoteUserService\",\"codeSource\":\"file:/F:/Workspace/ensoul-ruoyi/ensoul-admin-serv/ruoyi-api/ruoyi-api-system/target/classes/\",\"methods\":[{\"annotations\":[],\"name\":\"getUserInfo\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\"],\"parameters\":[],\"returnType\":\"org.dromara.system.api.model.LoginUser\"},{\"annotations\":[],\"name\":\"getUserInfoByPhonenumber\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\"],\"parameters\":[],\"returnType\":\"org.dromara.system.api.model.LoginUser\"},{\"annotations\":[],\"name\":\"getUserInfoByOpen