system-oracle.username}\n#          password: ${datasource.system-oracle.password}\n#          hikari:\n#            connectionTestQuery: SELECT 1 FROM DUAL\n#        postgres:\n#          type: ${spring.datasource.type}\n#          driverClassName: org.postgresql.Driver\n#          url: ${datasource.system-postgres.url}\n#          username: ${datasource.system-postgres.username}\n#          password: ${datasource.system-postgres.password}\n\n# 代码生成\ngen:\n  # 作者\n  author: chanbeiyu\n  # 默认生成包路径 system 需改成自己的模块名称 如 system monitor tool\n  packageName: org.dromara.system\n  # 自动去除表前缀，默认是false\n  autoRemovePre: false\n  # 表前缀（生成类名不会包含表前缀，多个用逗号分隔）\n  tablePrefix: sys_\n','f61beadedb3b2551e9894a9c600ecd1c','2010-05-05 00:00:00','2023-06-29 16:07:10','nacos','172.19.0.1','U','3001',''),(108,407,'ruoyi-job.yml','dev','','spring:\n  datasource:\n    dynamic:\n      # 设置默认的数据源或者数据源组,默认值即为 master\n      primary: master\n      datasource:\n        # 主库数据源\n        master:\n          type: ${spring.datasource.type}\n          driver-class-name: com.mysql.cj.jdbc.Driver\n          url: ${datasource.job.url}\n          username: ${datasource.job.username}\n          password: ${datasource.job.password}\n\nxxl:\n  job:\n    # 执行器开关\n    enabled: true\n    # 调度中心地址：如调度中心集群部署存在多个地址则用逗号分隔。\n    # admin-addresses: http://localhost:9900\n    # 调度中心应用名 通过服务名连接调度中心(启用admin-appname会导致admin-addresses不生效)\n    admin-appname: ruoyi-xxl-job-admin\n    # 执行器通讯TOKEN：非空时启用\n    access-token: xxl-job\n    # 执行器配置\n    executor:\n      # 执行器AppName：执行器心跳注册分组依据；为空则关闭自动注册\n      appname: ${spring.application.name}-executor\n      # 执行器端口号 执行器从19901开始往后写\n      port: 9901\n      # 执行器注册：默认IP:PORT\n      address:\n      # 执行器IP：默认自动获取IP\n      ip:\n      # 执行器运行日志文件存储磁盘路径\n      logpath: ./logs/${spring.application.name}/xxl-job\n      # 执行器日志文件保存天数：大于3生效\n      logretentiondays: 30\n','74e408b43f0165a135667e42a0130761','2010-05-05 00:00:00','2023-06-29 16:07:58','nacos','172.19.0.1','U','3001',''),(0,408,'ruoyi-powerjob-server.properties','dev','','oms.env=${spring.profiles.active}\r\n\r\n####### Database properties(Configure according to the the environment) #######\r\nspring.datasource.core.driver-class-name=com.mysql.cj.jdbc.Driver\r\nspring.datasource.core.jdbc-url=${datasource.powerjob.url}\r\nspring.datasource.core.username=${datasource.powerjob.username}\r\nspring.datasource.core.password=${datasource.powerjob.password}\r\nspring.datasource.core.maximum-pool-size=20\r\nspring.datasource.core.minimum-idle=5\r\n\r\n####### MongoDB properties(Non-core configuration properties)  #######\r\n####### delete mongodb config to disable mongodb #######\r\noms.mongodb.enable=false\r\n#spring.data.mongodb.uri=mongodb+srv://zqq:No1Bug2Please3!@cluster0.wie54.gcp.mongodb.net/powerjob_daily?retryWrites=true&w=majority\r\n\r\n####### Email properties(Non-core configuration properties) #######\r\n####### Delete the following code to disable the mail #######\r\n#spring.mail.host=smtp.163.com\r\n#spring.mail.username=zqq@163.com\r\n#spring.mail.password=GOFZPNARMVKCGONV\r\n#spring.mail.properties.mail.smtp.auth=true\r\n#spring.mail.properties.mail.smtp.starttls.enable=true\r\n#spring.mail.properties.mail.smtp.starttls.required=true\r\n\r\n####### DingTalk properties(Non-core configuration properties) #######\r\n####### Delete the following code to disable the DingTalk #######\r\n#oms.alarm.ding.app-key=dingauqwkvxxnqskknfv\r\n#oms.alarm.ding.app-secret=XWrEPdAZMPgJeFtHuL0LH73LRj-74umF2_0BFcoXMfvnX0pCQvt0rpb1JOJU_HLl\r\n#oms.alarm.ding.agent-id=847044348\r\n\r\n####### Resource cleaning properties #######\r\noms.instanceinfo.retention=1\r\noms.container.retention.local=1\r\noms.container.retention.remote=-1\r\n\r\n####### Cache properties #######\r\noms.instance.metadata.cache.size=1024\r\n\r\n# 生产配置\r\n#oms.instanceinfo.retention=7\r\n#oms.container.retention.local=7\r\n#oms.container.retention.remote=-1\r\n#oms.instance.metadata.cache.size=2048\r\n\r\n####### Threshold in precise fetching server(0~100). 100 means full detection of server, in which #######\r\n####### split-brain could be avoided while performance overhead would increase. #######\r\noms.accurate.select.server.percentage = 50\r\n','266a93c26e5e75b0ea9d9c2aabda012b','2010-05-05 00:00:00','2023-06-29 16:09:08',NULL,'172.19.0.1','I','3001',''),(308,409,'org.dromara.system.api.RemoteUserService:::provider:ruoyi-system','DUBBO_GROUP','','{\"annotations\":[],\"canonicalName\":\"org.dromara.system.api.RemoteUserService\",\"codeSource\":\"file:/F:/Workspace/ensoul-ruoyi/ensoul-admin-serv/ruoyi-api/ruoyi-api-system/target/classes/\",\"methods\":[{\"annotations\":[],\"name\":\"getUserInfo\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\"],\"parameters\":[],\"returnType\":\"org.dromara.system.api.model.LoginUser\"},{\"annotations\":[],\"name\":\"getUserInfoByPhonenumber\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\"],\"parameters\":[],\"returnType\":\"org.dromara.system.api.model.LoginUser\"},{\"annotations\":[],\"name\":\"getUserInfoByOpenid\",\"parameterTypes\":[\"java.lang.String\"],\"parameters\":[],\"returnType\":\"org.dromara.system.api.model.XcxLoginUser\"},{\"annotations\":[],\"name\":\"selectUserNameById\",\"parameterTypes\":[\"java.lang.Long\"],\"parameters\":[],\"returnType\":\"java.lang.String\"},{\"annotations\":[],\"name\":\"getUserInfoByEmail\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\"],\"parameters\":[],\"returnType\":\"org.dromara.system.api.model.LoginUser\"},{\"annotations\":[],\"name\":\"registerUserInfo\",\"parameterTypes\":[\"org.dromara.system.api.domain.bo.RemoteUserBo\"],\"parameters\":[],\"returnType\":\"java.lang.Boolean\"}],\"parameters\":{\"side\":\"provider\",\"application\":\"ruoyi-system\",\"pid\":\"7360\",\"dubbo\":\"2.0.2\",\"metadata-type\":\"remote\",\"release\":\"3.2.2\",\"anyhost\":\"true\",\"interface\":\"org.dromara.system.api.RemoteUserService\",\"executor-management-mode\":\"isolation\",