 MQ演示服务\n        - id: ruoyi-stream-mq\n          uri: lb://ruoyi-stream-mq\n          predicates:\n            - Path=/stream-mq/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: ruoyi-platform\n          uri: lb://ruoyi-platform\n          predicates:\n            - Path=/platform/**\n            - Path=/thoughts/**\n            - Path=/social/**\n          filters:\n            - StripPrefix=1\n\n    # sentinel 配置\n    sentinel:\n      filter:\n        enabled: false\n      # nacos配置持久化\n      datasource:\n        ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr}\n            dataId: sentinel-${spring.application.name}.json\n            groupId: ${spring.profiles.active}\n            namespace: ${spring.cloud.nacos.config.group}\n            data-type: json\n            rule-type: gw-flow\n','becbfa7673054fa258c633792ba1bc2c','2010-05-05 00:00:00','2023-07-01 15:13:16','nacos','172.19.0.1','U','3001',''),(518,567,'org.dromara.system.api.RemoteUserService:::provider:ruoyi-system','DUBBO_GROUP','','{\"annotations\":[],\"canonicalName\":\"org.dromara.system.api.RemoteUserService\",\"codeSource\":\"file:/F:/Workspace/ensoul-ruoyi/ensoul-admin-serv/ruoyi-api/ruoyi-api-system/target/classes/\",\"methods\":[{\"annotations\":[],\"name\":\"getUserInfo\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\"],\"parameters\":[],\"returnType\":\"org.dromara.system.api.model.LoginUser\"},{\"annotations\":[],\"name\":\"getUserInfoByPhonenumber\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\"],\"parameters\":[],\"returnType\":\"org.dromara.system.api.model.LoginUser\"},{\"annotations\":[],\"name\":\"getUserInfoByOpenid\",\"parameterTypes\":[\"java.lang.String\"],\"parameters\":[],\"returnType\":\"org.dromara.system.api.model.XcxLoginUser\"},{\"annotations\":[],\"name\":\"selectUserNameById\",\"parameterTypes\":[\"java.lang.Long\"],\"parameters\":[],\"returnType\":\"java.lang.String\"},{\"ann