n    whites:\n      - /code\n      - /auth/logout\n      - /auth/login\n      - /auth/smsLogin\n      - /auth/xcxLogin\n      - /auth/register\n      - /auth/tenant/list\n      - /resource/sms/code\n      - /*/v3/api-docs\n      - /*/error\n      - /csrf\n\nspring:\n  cloud:\n    # 网关配置\n    gateway:\n      # 打印请求日志(自定义)\n      requestLog: true\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: ruoyi-auth\n          uri: lb://ruoyi-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            # 验证码处理\n            - ValidateCodeFilter\n            - StripPrefix=1\n        # 代码生成\n        - id: ruoyi-gen\n          uri: lb://ruoyi-gen\n          predicates:\n            - Path=/tool/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: ruoyi-system\n          uri: lb://ruoyi-system\n          predicates:\n            - Path=/system/**,/monitor/**\n          filters:\n            - StripPrefix=1\n        # 资源服务\n        - id: ruoyi-resource\n          uri: lb://ruoyi-resource\n          predicates:\n            - Path=/resource/**\n          filters:\n            - StripPrefix=1\n        # 演示服务\n        - id: ruoyi-demo\n          uri: lb://ruoyi-demo\n          predicates:\n            - Path=/demo/**\n          filters:\n            - StripPrefix=1\n        # MQ演示服务\n        - id: ruoyi-stream-mq\n          uri: lb://ruoyi-stream-mq\n          predicates:\n            - Path=/stream-mq/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: ruoyi-platform\n          uri: lb://ruoyi-platform\n          predicates:\n            - Path=/platform/**,/thoughts/**,/social/**\n          filters:\n            - StripPrefix=1\n\n    # sentinel 配置\n    sentinel:\n      filter:\n        enabled: false\n      # nacos配置持久化\n      datasource:\n        ds1:\n          nacos:\n            server-addr: ${spring.cloud.nacos.server-addr}\n            dataId: sentinel-${spring.application.name}.json\n            groupId: ${spring.profiles.active}\n            namespace: ${spring.cloud.nacos.config.group}\n            data-type: json\n            rule-type: gw-flow\n','79b95fa5313a3c58758fad3667525f3f','2010-05-05 00:00:00','2023-07-11 17:55:21','nacos','172.19.0.1','U','3001',''),(582,695,'org.dromara.resource.api.RemoteMailService:::provider:ruoyi-resource','DUBBO_GROUP','','{\"annotations\":[],\"canonicalName\":\"org.dromara.resource.api.RemoteMailService\",\"codeSource\":\"file:/F:/Workspace/ensoul-ruoyi/ensoul-admin-serv/ruoyi-api/ruoyi-api-resource/target/classes/\",\"methods\":[{\"annotations\":[],\"name\":\"send\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\",\"java.lang.String\"],\"parameters\":[],\"returnType\":\"void\"},{\"annotations\":[],\"name\":\"sendWithAttachment\",\"parameterTypes\":[\"java.lang.String\",\"java.lang.String\",\"java.lang.String\",\"java.util.List<java.io.File>\"],\"parameters\":[],\"returnType\":\"void\"}],\"parameters\":{\"dubbo\":\"2.0.2\",\"metadata-type\":\"remote\",\"application\":\"ruoyi-resource\",\"release\":\"3.2.2\",\"interface\":\"org.dromara.resource.api.RemoteMailService\",\"anyhost\":\"true\",\"side\":\"provider\",\"pid\":\"51536\",\"executor-management-mode\":\"isolation\",\"file-cache\":\"true\",\"methods\":\"send,sendWithAttachment\",\"logger\":\"slf4j\",\"deprecated\":\"false\",\"service-name-mapping\":\"true\",\"register-mode\":\"instance\",\"qos.enable\":\"false\",\"generic\":\"false\",\"bind.port\":\"20881\",\"bind.ip\":\"192.168.31.37\",\"prefer.serialization\":\"fastjson2,hessian2\",\"background\":\"false\",\"dynamic\":\"true\",\"timestamp\":\"1689038342497\"},\"types\":[{\"enums\":[],\"items\":[],\"properties\":{},\"type\":\"void\"},{\"enums\":[],\"items\":[],\"properties\":{},\"type\":\"java.lang.String\"},{\"enums\":[],\"items\":[],\"properties\":{\"path\":\"java.lang.String\"},\"type\":\"java.io.File